import React, {Component} from 'react';
import ReactPlayer from 'react-player'
import testCreateVideo from './videos/testCreater.mp4'

class Video extends Component {
    render () {
        return (
         
            <ReactPlayer
              url='./videos/testCreater.mp4'
              width='100%'
              height='100%'
              onReady={true}
              loop={true}
            />
          
        )
      }
}   
       
export default Video;
